import React from 'react';
import './CaiButton.scss';

interface IProps {
    buttonValue: string;
    onClickButton: any;
}


const CaiButton = ({buttonValue, onClickButton}: IProps) => {
    return (
        <button onClick={onClickButton}>{buttonValue}</button>
    )
};

export default CaiButton;
